#include "../header.h"

class Solution {
public:
    int findValidSplit(const vector<int>& nums) {
        static const int MAXN = 10010;
        vector<bool> erato(MAXN, true);
        vector<int> primes;
        for (int i = 2; i < MAXN; ++i) {
            if (erato[i]) {
                primes.emplace_back(i);
                for (int j = i + i; j < MAXN; j += i) {
                    erato[j] = false;
                }
            }
        }

        const int n = nums.size();
        vector<unordered_map<int, int>> factors(n);
        for (int i = 0; i < n; ++i) {
            int num = nums[i];
            if (num < 0) {
                num = -num;
            }
            auto& f = factors[i];
            int j = 0;
            while (num != 1 && j < primes.size()) {
                if (num % primes[j] == 0) {
                    int p = 0;
                    while (num % primes[j] == 0) {
                        num /= primes[j];
                        ++p;
                    }
                    f[primes[j]] = p;
                }
                ++j;
            }
            if (num != 1) {
                ++f[num];
            }
        }

        unordered_map<int, int> left = factors[0];
        unordered_map<int, int> right;
        for (int i = 1; i < n; ++i) {
            for (const auto& p: factors[i]) {
                right[p.first] += p.second;
            }
        }

        for (int i = 1; i < n; ++i) {
            bool good = true;
            for (const auto& p: left) {
                if (right[p.first] > 0) {
                    good = false;
                    break;
                }
            }

            if (good) {
                return i - 1;
            }

            for (const auto& p: factors[i]) {
                left[p.first] += p.second;
                right[p.first] -= p.second;
            }
        }

        return -1;
    }
};

